import React, { Component } from "react";
import Expanded from "./Assets/ExpandedInsurence.jpg";
const programs = [
  { title: "Program 1", count: "program COUNT" },
  { title: "Program 2", count: "program COUNT" },
  { title: "Program 3", count: "program COUNT" },
  { title: "Program 4", count: "program COUNT" },
  { title: "Program 5", count: "program COUNT" },
  { title: "Program 6", count: "program COUNT" },
  { title: "Program 7", count: "program COUNT" },
  { title: "Program 8", count: "program COUNT" },
  { title: "Program 9", count: "program COUNT" },
  { title: "Program 10", count: "program COUNT" },
];
class Benefits extends React.Component {
  render() {
    return (
      <div className="benefits__container">
        {programs.map((program, index) => (
          <div key={index} className="benefits__item">
            <h2>{program.title}</h2>
            <p>{program.count}</p>
          </div>
        ))}
      </div>
    );
  }
}

export default Benefits;
